import React from 'react';
import { connect } from 'react-redux';
import { fetchReservations } from '../../../store/actions/reservationActions';

class NewOrderNotif extends React.Component {

    componentDidMount() {
        this.props.fetchReservations();
    }

    render() {
        return (
            <div>NewOrder</div>
        )
    }
}


export default connect(mapStateToProps,{ fetchReservations })(NewOrderNotif)
